import React from "react";

const ArtistInfo = ({ artistData }) => {
  if (!artistData) {
    return null;
  }

  // Access artist information from props (assuming the data structure)
  const artistName = artistData.name;
  const genres = artistData.genres.join(", "); // Join genres into a comma-separated string
  const followers = artistData.followers.total;
  const imageUrl = artistData.images[0]?.url; // Optional image handling

  return (
    <div className="artist-info">
      {imageUrl && <img src={imageUrl} alt={artistName} />}{" "}
      {/* Display image if available */}
      <h2>{artistName}</h2>
      <p>Genres: {genres}</p>
      <p>Followers: {followers}</p>
    </div>
  );
};

export default ArtistInfo;
